import React, { useState, useEffect } from "react";
import DesenvolvedoresForm from "../components/Desenvolvedores/DesenvolvedoresForm";
import DesenvolvedoresList from "../components/Desenvolvedores/DesenvolvedoresList";
import axios from "axios";

function DesenvolvedoresPage() {
  const [desenvolvedores, setDesenvolvedores] = useState([]);
  const [niveis, setNiveis] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const getDesenvolvedores = async () => {
      try {
        const response = await axios.get(
          "http://localhost:3002/api/desenvolvedores"
        );
        setDesenvolvedores(response.data);
      } catch (error) {
        console.error("Erro ao buscar desenvolvedores:", error);
        setError("Erro ao buscar desenvolvedores. Por favor, tente novamente.");
      }
    };

    const getNiveis = async () => {
      try {
        const response = await axios.get("http://localhost:3002/api/niveis");
        setNiveis(response.data);
      } catch (error) {
        console.error("Erro ao buscar níveis:", error);
        setError("Erro ao buscar níveis. Por favor, tente novamente.");
      }
    };

    getDesenvolvedores();
    getNiveis();
  }, []);

  const handleAddDesenvolvedor = async (novoDesenvolvedor) => {
    try {
      const response = await axios.post(
        "http://localhost:3002/api/desenvolvedores",
        novoDesenvolvedor
      );
      setDesenvolvedores([...desenvolvedores, response.data]);
      setError(null);
    } catch (error) {
      console.error("Erro ao adicionar desenvolvedor:", error);
      setError("Erro ao adicionar desenvolvedor. Por favor, tente novamente.");
    }
  };

  return (
    <div className="min-h-screen bg-[#111827] flex items-center justify-center py-8">
      <div className="w-full max-w-4xl bg-[#374151] p-8 rounded-lg shadow-lg">
        {error && <p className="text-red-500 mb-4">{error}</p>}
        <DesenvolvedoresForm
          onSubmit={handleAddDesenvolvedor}
          niveis={niveis}
        />
        <DesenvolvedoresList desenvolvedores={desenvolvedores} />
      </div>
    </div>
  );
}

export default DesenvolvedoresPage;
